import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { Turma, Aluno } from '../types';
import { apiService } from '../services/api';

const TurmaDetalhePage: React.FC = () => {
  const { id } = useParams<{ id: string }>();
  const navigate = useNavigate();
  const [turma, setTurma] = useState<Turma | null>(null);
  const [alunos, setAlunos] = useState<Aluno[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchTurmaDetails = async () => {
      if (!id) return;

      try {
        setLoading(true);
        const turmaId = parseInt(id);

        // Buscar dados da turma e alunos inscritos
        const [turmaData, alunosData] = await Promise.all([
          apiService.getTurma(turmaId),
          apiService.getAlunosPorTurma(turmaId)
        ]);

        setTurma(turmaData);
        setAlunos(alunosData);
      } catch (err) {
        setError('Erro ao carregar detalhes da turma');
        console.error('Erro ao buscar detalhes da turma:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchTurmaDetails();
  }, [id]);

  if (loading) return <div>Carregando...</div>;
  if (error) return <div>Erro: {error}</div>;
  if (!turma) return <div>Turma não encontrada</div>;

  return (
    <div style={{ padding: '20px' }}>
      <button
        onClick={() => navigate('/turmas')}
        style={{
          marginBottom: '20px',
          padding: '10px 15px',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer'
        }}
      >
        ← Voltar para Turmas
      </button>

      <h1>Detalhes da Turma</h1>

      <div style={{
        border: '1px solid #ddd',
        padding: '20px',
        borderRadius: '5px',
        backgroundColor: '#f9f9f9',
        marginBottom: '30px'
      }}>
        <h2>{turma.disciplina.nome}</h2>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: '10px' }}>
          <p><strong>Ano:</strong> {turma.ano}</p>
          <p><strong>Período:</strong> {turma.periodo}</p>
          <p><strong>Professor:</strong> {turma.professor.nome}</p>
          <p><strong>Código da Disciplina:</strong> {turma.disciplina.codigo}</p>
          <p><strong>Carga Horária:</strong> {turma.disciplina.cargaHoraria}h</p>
          <p><strong>Departamento:</strong> {turma.professor.departamento}</p>
        </div>
      </div>

      <h3>Alunos Inscritos ({alunos.length})</h3>
      {alunos.length === 0 ? (
        <p>Nenhum aluno inscrito nesta turma.</p>
      ) : (
        <div style={{ display: 'grid', gap: '10px' }}>
          {alunos.map((aluno) => (
            <div
              key={aluno.id}
              style={{
                border: '1px solid #ddd',
                padding: '15px',
                borderRadius: '5px',
                backgroundColor: 'white'
              }}
            >
              <h4>{aluno.nome}</h4>
              <p><strong>Matrícula:</strong> {aluno.matricula}</p>
              <p><strong>Email:</strong> {aluno.email}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default TurmaDetalhePage;
